import React, {Component} from 'react'

export default class IssueList extends Component {

    constructor(props){
        super(props);

        this.state = {
            data:null,
        };
    }

    componentDidMount(){
        fetch('http://localhost:8080/issues')
        .then(response => response.json())
        .then(data => this.setState({data}))
    }

    render(){
        return(
            <h3>{this.state.data}</h3>
        )
    }
}
